-- =============================================================================
-- Migration 017: Property Data (Buildings & Apartments from Tri-logis)
-- Feature: Maintenance session tracking - property reference data
-- =============================================================================

-- Table: property_buildings (76 buildings from Tri-logis property management)
CREATE TABLE property_buildings (
  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
  name TEXT NOT NULL,
  address TEXT NOT NULL,
  city TEXT NOT NULL,
  state TEXT,
  zip_code TEXT,
  total_units INTEGER DEFAULT 0,
  year_built INTEGER,
  is_active BOOLEAN DEFAULT true,
  cadastre TEXT,
  matricule TEXT,
  created_at TIMESTAMPTZ DEFAULT now(),
  updated_at TIMESTAMPTZ DEFAULT now()
);

-- Table: apartments (units within property_buildings)
CREATE TABLE apartments (
  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),
  building_id UUID NOT NULL REFERENCES property_buildings(id),
  apartment_name TEXT NOT NULL,
  unit_address TEXT NOT NULL,
  unit_number TEXT,
  apartment_category TEXT DEFAULT 'Residential'
    CHECK (apartment_category IN ('Residential','Commercial','Storage','Office','Parking','Chalet','Sold')),
  floor INTEGER,
  bedrooms INTEGER,
  bathrooms NUMERIC,
  square_feet INTEGER,
  rooms_notation TEXT,
  is_active BOOLEAN DEFAULT true,
  market_rent NUMERIC,
  on_hold BOOLEAN DEFAULT false,
  civic_number TEXT,
  street TEXT,
  created_at TIMESTAMPTZ DEFAULT now(),
  updated_at TIMESTAMPTZ DEFAULT now()
);

-- Indexes
CREATE INDEX idx_property_buildings_active ON property_buildings(is_active);
CREATE INDEX idx_apartments_building_active ON apartments(building_id, is_active);
CREATE INDEX idx_apartments_category ON apartments(apartment_category);

-- Trigger: auto-update updated_at
CREATE TRIGGER trg_property_buildings_updated_at
  BEFORE UPDATE ON property_buildings
  FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

CREATE TRIGGER trg_apartments_updated_at
  BEFORE UPDATE ON apartments
  FOR EACH ROW EXECUTE FUNCTION update_updated_at_column();

-- =============================================================================
-- RLS Policies (read-only reference data for authenticated users)
-- =============================================================================

ALTER TABLE property_buildings ENABLE ROW LEVEL SECURITY;
ALTER TABLE apartments ENABLE ROW LEVEL SECURITY;

CREATE POLICY property_buildings_select ON property_buildings
  FOR SELECT TO authenticated
  USING (true);

CREATE POLICY apartments_select ON apartments
  FOR SELECT TO authenticated
  USING (true);

